   "source": [
    "T=0.8\n",
    "ρ=0.7\n",
    "dt=1e-3\n",
    "γ=1.0\n",
    "r=3.0\n",
    "\n",
    "forcing_type=\"SINUSOIDAL\"\n",
    "t_eq=20\n",
    "n_iter_sim=1\n",
    "\n",
    "Nx=10\n",
    "splitting=\"BAOAB\"\n",
    "r_c=2.5\n",
    "y_ratio = 2\n",
    "z_ratio = 0.5\n",
    "\n",
    "Ny=round(Int64,Nx*y_ratio)\n",
    "Nz=round(Int64,Nx*z_ratio)\n",
    "\n",
    "N=Nx*Ny*Nz"
   ]
  },
